const Sample=((props)=>{
    const {studentData}=props;
    const store=studentData.map((ele,index)=>{
      return(
        <tr>
            <td>{index}</td>
            <td>{ele.name}</td>
            <td>{ele.branch}</td>
        </tr>        
      )
    })
    return(
        <div>
          <h2>hello {props.user}!</h2>
          <table>
            <thead>
              <th>Id</th>
              <th>Name</th>
              <th>Branch</th>
            </thead>
            <tbody>
              {store}
            </tbody>
          </table>
        </div>
    )
})

